import React, {Component} from 'react';
import {Nav, Navbar} from 'react-bootstrap'

export default class navbar extends Component {
    constructor(props) {
        super(props)
        this.state = {
            isLoggedIn: ""
        }
    }

    render() {
        if(isLoggedIn === 0) {
            return (
                <div class="app">
                    <Navbar bg="dark" variant="dark" sticky="top" expand="lg">
                    <Navbar.Brand>
                        <Nav.Link href='/'>MyReactApp</Nav.Link>
                    </Navbar.Brand>
    
                    <Navbar.Toggle />
                    <Navbar.Collapse>
                        <Nav>
                            <Nav.Link href="/">Home Page</Nav.Link> 
                            <Nav.Link href="/login">Login</Nav.Link>  
                            <Nav.Link href="/register">Register</Nav.Link>    
                        </Nav>
                    </Navbar.Collapse>
                    </Navbar>
                </div>
            );
        }
        else {
            return (
                <div class="app">
                    <Navbar bg="dark" variant="dark" sticky="top" expand="lg">
                    <Navbar.Brand>
                        <Nav.Link href='/'>Welcome User</Nav.Link>
                    </Navbar.Brand>
    
                    <Navbar.Toggle />
                    <Navbar.Collapse>
                        <Nav>
                            <Nav.Link href="/">Home Page</Nav.Link> 
                        </Nav>
                    </Navbar.Collapse>
                    </Navbar>
                </div>
            );
        }
    }
}
